#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  {
    SELECT ?x (MAX(?yr) AS ?recent_yr)
    WHERE {
      ns:m.0d060g ns:location.location.contains ?x . # Canada
      ?x ns:common.topic.notable_types ns:m.01nm . # Canadian Province
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
    GROUP BY ?x 
  }
  {
    SELECT ?x ?p ?yr
    WHERE {
      ns:m.0d060g ns:location.location.contains ?x . # Canada
      ?x ns:common.topic.notable_types ns:m.01nm . # Canadian Province
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
  }
  FILTER (?yr = ?recent_yr)
}
ORDER BY DESC(xsd:integer(?p))
LIMIT 1
